import './index.css';
import List from './List'
import people from './data';

function App() {
  return (
    <div className="main w-full max-w-md p-4 bg-white border rounded-lg shadow-md sm:p-8 dark:bg-gray-800 dark:border-gray-700">
      <div className="flex items-center justify-between mb-4">
        <h5 className="text-xl font-bold leading-none text-gray-900 dark:text-white">Latest Customers</h5>
        <button type='button' className="text-sm font-medium text-blue-600 hover:underline dark:text-blue-500">
            Clear all
        </button>
      </div>
    </div>
  );
}

export default App;
